import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import { useNavigate } from "react-router-dom";
import IconButton from '@mui/material/IconButton';
import ChevronLeftIcon from '@mui/icons-material/ChevronLeft';
import classes from './Login.module.css';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';

import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import InputAdornment from '@mui/material/InputAdornment';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';

const Registration = props => {
    const navigate = useNavigate()

    const goBackHandler = () => {
        navigate("/Login")
    }
    // let { registration } = useParams();
    return (
        <Box>
            <Card variant="outlined" sx={{ maxWidth: 700, maxHeight: 7000, borderRadius: 5, borderColor: 'primary.main', paddingTop: 1, m: 1 }} margin="10px">
                <CardActions>
                    <IconButton sx={{ marginLeft: 1, }} onClick={goBackHandler}>
                        <ChevronLeftIcon />
                    </IconButton>
                </CardActions>
                <CardContent>
                    <Typography variant="h4" component='div' fontSize='26px' className={classes.registration}>Register Here</Typography>
                    <Box
                        component="form"
                        sx={{
                            marginTop: 5,
                            marginLeft: 0, 
                            '& .MuiTextField-root': { m: 1, width: '70ch' },
                            // '& .MuiButton-root': { marginRight:10 },
                        }}
                        noValidate
                        autoComplete="off"
                    >
                        <div>
                                <TextField
                                    required
                                    multiline
                                    fullWidth
                                    size='medium'
                                    id="first-name"
                                    label="Enter Your Name"
                                    placeholder="xyz abc"
                            />
                            <TextField
                                required
                                multiline
                                fullWidth
                                size='medium'
                                id="email-id"
                                label="Enter Your Email Address"
                                placeholder="xyz@abc.com"
                            />
                            <TextField
                                required
                                multiline
                                fullWidth
                                size='medium'
                                id="username"
                                label="Enter Your UserName"
                                placeholder="xyz_abc123"
                            />
                            <TextField
                                required
                                id="new password"
                                label="Enter New Password"
                                type="password"
                                placeholder="*******"
                                autoComplete="current-password"
                            />
                                <TextField
                                    required
                                    id="confirm-password"
                                    label="Enter Confirm Password"
                                    type="password"
                                    placeholder="*******"
                                    autoComplete="current-password"
                            />
                            <FormControl sx={{ m: 1, width: '25ch' }} variant="outlined">
                                <InputLabel htmlFor="outlined-adornment-password">Password</InputLabel>
                                <OutlinedInput
                                    id="outlined-adornment-password"
                                    type={values.showPassword ? 'text' : 'password'}
                                    value={values.password}
                                    onChange={handleChange('password')}
                                    endAdornment={
                                        <InputAdornment position="end">
                                            <IconButton
                                                aria-label="toggle password visibility"
                                                onClick={handleClickShowPassword}
                                                onMouseDown={handleMouseDownPassword}
                                                edge="end"
                                            >
                                                {values.showPassword ? <VisibilityOff /> : <Visibility />}
                                            </IconButton>
                                        </InputAdornment>
                                    }
                                    label="Password"
                                />
                            </FormControl>


                            <div className={classes.button}>
                                <Button
                                    variant="contained"
                                    onClick={props.onClick}
                                    sx={{
                                        marginTop: 0.5,
                                        marginRight: -38.5,

                                    }}>
                                    Submit</Button>
                            </div>
                        </div>
                    </Box>
                </CardContent>
            </Card>
        </Box>
    );

};
export default Registration;
